import AdminCompanySidebar from './AdminCompanySidebar/AdminCompanySidebar'

export default function Companies() {
    return (
        <div className='Companies'>
            <Route path="/admin/companies">
                <AdminCompanySidebar />
            </Route>
        </div>)
}
